ho, exceto se for demitido por justa causa.','Os29b1cq9q4','2016-11-26 21:47:02.562173','2016-08-31 11:05:31.000000','thumbnails/225/gBwFXL5kebaU3DFfnL42mQ','0,21280,718','Direito do Trabalho - Aula 76 - Férias Proporcionais na Rescisão do Trabalho - Art. 146 e 147 da CLT','',NULL),(226,'O Silêncio Importa Anuência nos Negócios Jurídicos - Art.111 do CC','Nessa aula a prof. Sefora Schubert ensina o Art. 111 do Código Civil que trata do silêncio como manifestação de vontade nos negócios jurídicos.','CvhZY-nNX4U','2016-11-26 21:47:02.739633','2016-04-04 11:42:56.000000','thumbnails/226/LJdb5EQtqDdyLQ5C7CaspF','0,21280,718','Direito Civil - Aula 76 - O Silêncio Importa Anuência nos Negócios Jurídicos- Art.111 do CC','',NULL),(227,'Natureza Salarial das Férias - Art. 148 e 449 da CLT','Nessa aula o prof. Ricardo explica que as férias pagas durante a contratualidade terão natureza salarial para todos os efeitos, enquanto as férias indenizadas somente terão natureza salarial para a habilitação do crédito trabalhista no processo de falência do empregador.','t5mnd5-gXnc','2016-11-26 21:47:02.904641','2016-09-26 22:26:16.000000','thumbnails/227/pVndvwFx4CZ78h97pwDjv7','0,21280,718','Direito do Trabalho - Aula 77 - Natureza Salarial das Férias - Art. 148 e 449 da CLT','',NULL),(228,'A Intenção das Partes nos Negócios Jurídicos - Art.112 do CC','Nessa aula a prof. Sefora Schubert explica o Art. 112 do Código Civil, que determina que quando houver conflito entre a vontade declarada e o sentido literal da linguagem, deverá prevalecer a vontade (intenção).','VB4DGD0rvm8','2016-11-26 21:47:03.054436','2016-04-08 12:28:22.000000','thumbnails/228/MS9aa4mDn7BDVGeCRMeZQW','0,21280,718','Direito Civil - Aula 77 -  A Intenção das Partes nos Negócios Jurídicos- Art.112 do CC','',NULL),(229,'Início do Prazo Prescricional das Férias - Art. 149 e 449 da CLTo','Nessa aula o prof. Ricardo Schubert explica o prazo prescricional das férias.','2V91iakIJoo','2016-11-26 21:47:05.592251','2016-11-16 23:19:09.000000','thumbnails/229/FPqtJm5ixU2PLCAbfc9JN9','0,21280,718','Direito do Trabalho - Aula 78 - Início do Prazo Prescricional das Férias - Art. 149 e 449 da CLTo','',NULL),(230,'Boa - fé nos Negócios Jurídicos - Art.113 do Código Civil','Nessa aula a prof. Sefora Schubert explica o Art. 113 do CC que determina que os negócios jurídicos devem ser interpretados conforme a boa-fé e os usos do lugar de sua celebração.','TtOIziiokvA','2016-11-26 21:47:05.930778','2016-04-11 12:35:41.000000','thumbnails/230/53UHtX6gC8ZTCXgk2NiCkn','0,21280,718','Direito Civil - Aula 78 -  Boa-fé nos Negócios Jurídicos- Art.113 do Código Civil','',NULL),(231,'Interpretação Estrita dos Negócios Benéficos e Renúncia - Art.114 do CC','Nessa aula a prof. Sefora Schubert explica o Art. 114 do Código Civil, que determina que os negócios jurídicos benéficos e a Renúncia devem ser interpretados estritamente.','JPt7GXD1odo','2016-11-26 21:47:06.116513','2016-04-15 10:29:20.000000','thumbnails/231/Ge8QhzLE5XUyaiAmBXZtQC','0,21280,718','Direito Civil - Aula 79 -  Interpretação Estrita dos Negócios Benéficos e Renúncia - Art.114 do CC','',NULL),(232,'Representação Legal e Representação Voluntária - Art.115 do CC','Nessa aula a prof. Sefora Schubert explica que Representação é agir juridicamente em nome de outra pessoa e que existem 2 tipos de representação: legal e voluntária.','q7cwSVOfPWk','2016-11-26 21:47:06.289000','2016-04-18 12:03:43.000000','thumbnails/232/rLqcRFmTCsy5LMEfFEbguh','0,21280,718','Direito Civil - Aula 80 -  Representação Legal e Representação Voluntária - Art.115 do CC','',NULL),(233,'Representação e seus Efeitos - Art.116 do Código Civil','Nessa aula a Prof. Séfora Schubert explica o Art. 116 do Código Civil que especifica que os atos realizados pelo Representante surtem efeitos em relação ao representado.','Kq-0yC_w2ig','2016-11-26 21:47:06.441789','2016-04-24 19:16:44.000000','thumbnails/233/NEg8yHMJBWjWjKaS3Y9MnV','0,21280,718','Direito Civil - Aula 81 -  Representação e seus Efeitos - Art.116 do Código Civil','',NULL),(234,'Representante Pode Celebrar Negócios Consigo Mesmo? - Art.117 do CC','Nessa aula a prof. Séfora Schubert explica que é anulável o negócio jurídico que o representante celebrar consigo mesmo.','nlSgX4vlK5A','2016-11-26 21:47:06.611203','2016-04-27 14:02:31.000000','thumbnails/234/jugDLKGQ3HPZ4y3337M54h','0,21280,718','Direito Civil - Aula 82 -  Representante Pode Celebrar Negócios Consigo Mesmo? - Art.117 do CC','',NULL),(235,'Obrigação de Provar a Representação - Art.118 do CC','Nessa aula a prof. Séfora Schubert explica que, nos termos do Art. 118 do CC, o Representante é obrigada a provar a sua qualidade de representante e a extensão de seus poderes.','8A4lJ7ysaMM','2016-11-26 21:47:06.792882','2016-04-29 09:44:22.000000','thumbnails/235/yZbCTN7ufxSNP7UNeGtbyR','0,21280,718','Direito Civil - Aula 83 -  Obrigação de Provar a Representação - Art.118 do CC','',NULL),(236,'Conflito de Interesses Entre o Representante e Representado - Art.119 CC','Nessa aula a prof. Séfora Schubert explica que é anulável o negócio jurídico realizado com conflito de interesses entre o Representante e o Representado.','nTm_1yqLaJk','2016-11-26 21:47:06.992458','2016-05-04 11:07:06.000000','thumbnails/236/iXk7nL7f8yNjuXATdhj2V4','0,21280,718','Direito Civil - Aula 84 -  Conflito de Interesses Entre o Representante e Representado - Art.119 CC','',NULL),(237,'Regulamentação da Representação - Art.120 Código Civil','Nessa aula a Prof. Séfora Schubert explica que a Representação Legal é regulamentada pelas normas específicas, já a Representação Voluntária é regulamentada pela parte Especial do Código Civil. \nMai vídeos acesse: http://www.direitoemtela.com.br','PO9ivC98gd8','2016-11-26 21:47:07.159523','2016-05-06 09:33:08.000000','thumbnails/237/akiP7XdgQ6kB3uAFKSRne4','0,21280,718','Direito Civil - Aula 85 -  Regulamentação da Representação - Art.120 Código Civil','',NULL),(238,'Condição - Art.121 Código Civil','Nessa aula  a prof. Séfora Schubert explica que a condição é uma cláusula do negócio jurídico, que deriva da vontade das partes, e subordina a eficácia do negocio  a um evento futuro e incerto.','zOBeGLl6-ps','2016-11-26 21:47:07.369107','2016-05-13 10:01:21.000000','thumbnails/238/XeRMfLj4ZHipzJzWuuSrRk','0,21280,718','Direito Civil - Aula 86 -  Condição - Art.121 Código Civil','',NULL),(239,'Condição Suspensiva e Condição Resolutiva - Art. 121 CC','Nessa aula a prof. Séfora Schubert explica a condição suspensiva e a condição resolutiva, e seus efeitos no negócio jurídico.','xmxyG01sIoQ','2016-11-26 21:47:07.552040','2016-05-16 12:39:49.000000','thumbnails/239/dm4B6j4aALpijkQHMwgwcL','0,21280,718','Direito Civil - Aula 87 - Condição Suspensiva e Condição Resolutiva - Art. 121 CC','',NULL),(240,'Fases da Condição - Art.121 Código Civil','Nessa aula a prof. Séfora Schubert ensina que a condição possui três fases: Fase da Pendência; Fase do Implemento e Fase da Frustração.','v9zlsOveVvI','2016-11-26 21:47:07.721951','2016-05-18 10:52:55.000000','thumbnails/240/u3EoXNnqBS7HhqYbvypjLH','0,21280,718','Direito Civil - Aula 88 -  Fases da Condição - Art.121 Código Civil','',NULL),(241,'Condição Suspensiva - Art. 125 Código Civil','Nessa aula a prof. Séfora Schubert explica o Art. 125 do Código Civil que trata dos efeitos do negócio jurídico sob condição suspensiva.','TNIaGL6GYto','2016-11-26 21:47:07.924848','2016-05-25 10:16:01.000000','thumbnails/241/MziCoSYgSedHe3227QrfDK','0,21280,718','Direito Civil - Aula 89 - Condição Suspensiva - Art. 125 Código Civil','',NULL),(242,'Condição Resolutiva - Art. 127 e 128 do  Código Civil','Nessa aula a prof. Séfora Schubert explica que a Condição Resolutiva é uma cláusula que as partes podem inserir no negócio jurídico e que condiciona a eficácia desse negócio a um evento futuro e incerto.','XbBApI0ci5k','2016-11-26 21:47:08.112979','2016-06-03 10:13:06.000000','thumbnails/242/LAPu3AU3AjaUaMf8hWLNfm','0,21280,718','Direito Civil - Aula 90 - Condição Resolutiva - Art. 127 e 128 do  Código Civil','',NULL),(243,'Condição Ilícita - Art. 122 e 123, II e III do Código Civil','Nessa aula a prof. Séfora Schubert explica que as condições ilícitas, previstas no Art. 122 do CC são aquelas contrárias à lei, contrárias à ordem pública, contrárias aos bons costumes, perplexas, contraditórias e as puramente potestativas.','JzMxG9p2Q9w','2016-11-26 21:47:08.321239','2016-06-10 18:14:09.000000','thumbnails/243/fYxb4KZjb65XVAEEnmcLFm','0,21280,718','Direito Civil - Aula 91 - Condição Ilícita - Art. 122 e 123, II e III do Código Civil','',NULL),(244,'Condição Impossível Suspensiva e Resolutiva - Art. 123, I, e Art. 124 CC','Nessa aula a Prof. Sefora Schubert explica que a condição suspensiva, quando impossível, invalida o negócio jurídico; por sua vez a condição resolutiva, quando impossível, tem-se por inexistente.','iCRCMOpreew','2016-11-26 21:47:08.510342','2016-06-15 10:23:54.000000','thumbnails/244/J9uuHGpGJdafG9BTtmrRrJ','0,21280,718','Direito Civil - Aula 93 -  Art. 123, I, e Art. 124 CC - Condição Impossível Suspensiva e Resolutiva','',NULL),(245,'Novas Disposições Quanto à Coisa sob Condição Suspensiva - Art. 126 CC','Nessa aula a prof. Séfora Schubert explica o Art. 126 do CC, que determina que se forem feitas novas disposições quanto à coisa sob condição suspensiva, as novas disposições não terão valor se forem incompatíveis cm a condição. \nContribua com a nova plataforma do Canal Direito em Tela: http://www.kickante.com.br/campanhas/plataforma-para-o-canal-direito-em-tela','sTsqigs60Ko','2016-11-26 21:47:08.678892','2016-06-17 09:50:20.000000','thumbnails/245/q6NZhUFG2GXiCrqqwbxr6c','0,21280,718','Direito Civil - Aula 94 - Art. 126 CC - Novas Disposições Quanto à Coisa sob Condição Suspensiva','',NULL),(246,'Implemento Malicioso da Condição - Art. 129 CC','Nessa aula a prof. Séfora Schubert explica que quando a parte impede maliciosamente a ocorrência da condição, o juiz irá considerar como implementada a condição; e quando a parte levar a implemento maliciosamente a ocorrência da condição, o juiz irá considerar como não implementada a condição.','5q2ZSQY-T6c','2016-11-26 21:47:08.813950','2016-06-27 13:09:29.000000','thumbnails/246/qgYiHZyqxtjsyVssXa6W56','0,21280,718','Direito Civil - Aula 95 - Art. 129 CC - Implemento Malicioso da Condição','',NULL),(247,'O Titular do Direito Eventual nos Casos de Condição - Art. 130 CC','Nessa aula a prof. Séfora Schubert ensina o Art. 130 do CC que determina que o Titular de direito eventual pode praticar atos destinados a conservar o seu direito.','ypLY5YPJ8jQ','2016-11-26 21:47:08.951792','2016-06-29 18:00:44.000000','thumbnails/247/T8x8EiLSbc5wGodT9bGqa8','0,21280,718','Direito Civil - Aula 96 - Art. 130 CC - O Titular do Direito Eventual nos Casos de Condição','',NULL),(248,'Termo - Art. 131 do Código Civil','Nessa aula a prof. Séfora Schubert  explica que o termo sujeito a eficácia do  negócio jurídico a um evento futuro e certo.','97pUnt7Go0Q','2016-11-26 21:47:09.140645','2016-07-01 14:00:46.000000','thumbnails/248/TT6RtRVhx7fT5R3NTYS7pZ','0,21280,718','Direito Civil - Aula 97 - Termo - Art. 131 do Código Civil','',NULL),(249,'Termo Inicial e Termo Final - Art. 131 e 135 do CC','Nessa aula a prof. Séfora Schubert explica que o Termo Inicial suspende o exercício, mas não a aquisição do direito.','U91vc5T5Xkk','2016-11-26 21:47:09.371643','2016-07-04 16:58:00.000000','thumbnails/249/QxMJyumFrRN5MafVoHxpJY','0,21280,718','Direito Civil - Aula 98 - Art. 131 e 135 do CC - Termo Inicial e Termo Final','',NULL),(250,'Prazos - Art. 132 CC','Nessa aula a prof. Séfora Schubert explica o que é prazo; como são contados os prazos nos negócios jurídicos; o que é meado e o que ocorre quando um prazo vence em um feriado.','KWfdkc2enI0','2016-11-26 21:47:09.539326','2016-07-08 13:59:25.000000','thumbnails/250/R8Yn7ewp37BF2VMPqSWc5B','0,21280,718','Direito civil - Aula 99 - Art. 132 CC - Prazos','',NULL),(251,'Negócios Jurídicos Sem Prazo - Art. 134 do CC','Nessa aula a prof. Séfora Schubert explica  o Art. 134 do Código Civil que determina que os negócios jurídicos sem prazo são exequíveis desde logo, exceto se a execução do negócio depender de tempo ou tiver que ser feita em lugar diverso.','aEbyN_1_kJc','2016-11-26 21:47:09.782916','2016-07-13 10:21:22.000000','thumbnails/251/Ea4RngbUqkZGTyc298gRkW','0,21280,718','Direito Civil - Aula 100 - Art. 134 do CC - Negócios Jurídicos Sem Prazo','',NULL),(252,'O Prazo Presume - Art. 133 do CC - se em Favor do Herdeiro e do Devedor','Nessa aula a prof. Séfora Schubert explica que nos negócios jurídicos os prazos se presumem a favor do herdeiro e do devedor.','ZLv1HBO382U','2016-11-26 21:47:09.981105','2016-07-15 11:49:51.000000','thumbnails/252/yYATRiKsux7WwnDoZaLZXc','0,21280,718','Direito Civil - Aula 101 - Art. 133 do CC - O Prazo Presume-se em Favor do Herdeiro e do Devedor','',NULL),(253,'Encargo ou Modo - Elemento Acessório dos Negócios Jurídicos','Nessa aula a prof. Séfora Schubert explica que Encargo é uma restrição feita a uma liberalidade. Ensina, ainda, que Encargo é um elemento acessório, ou acidental, do Negócio Jurídico.','df-l4rRBRLw','2016-11-26 21:47:10.141588','2016-07-27 11:57:30.000000','thumbnails/253/Sh5qJ2pHXwX4N8LeHNekCX','0,21280,718','Direito Civil -  Aula 102 -  Encargo ou Modo - Elemento Acessório dos Negócios Jurídicos','',NULL),(254,'Encargo ou Modo - Art. 136 do Código Civil','Nessa aula a prof. Séfora Schubert explica que o Encargo não suspende nem a aquisição e nem o exercício do direito nos negócios jurídicos, salvo se imposto expressamente como condição suspensiva.','8VPe0K0gMJg','2016-11-26 21:47:10.327631','2016-07-30 13:38:17.000000','thumbnails/254/MyuF3oVvztPaorAaxZUb8F','0,21280,718','Direito Civil -  Aula 103 -  Encargo ou Modo - Art. 136 do Código Civil','',NULL),(255,'Descumprimento do Encargo no Negócio Jurídico - Art. 136  e ss do CC','Nessa aula a prof. Séfora Schubert  explica que o beneficiário da liberalidade não é obrigada a aceitar o encargo, mas se aceitar terá que cumprir.','wKwmKFGZv4s','2016-11-26 21:47:10.535524','2016-08-01 10:56:22.000000','thumbnails/255/L23imGnAArYgUwSbdETSpZ','0,21280,718','Direito Civil -  Aula 104 -  Descumprimento do Encargo no Negócio Jurídico - Art. 136  e ss do CC','',NULL),(256,'Encargo Ilícito ou Impossível - Art. 137 do CC','Nessa aula a prof. Séfora Schubert explica que quando existe uma Liberalidade quando gravada com um encargo ilícito ou impossível, tem-se como não escrito o encargo. Por outro lado, se o encargo, ilícito ou impossível, for imposto como motivo determinante da liberalidade, nesse caso anula o negócio jurídico.','H7YKs4lO29k','2016-11-26 21:47:10.776741','2016-08-04 02:48:45.000000','thumbnails/256/nD8QakDtZBAH6erC6rn6HV','0,21280,718','Direito Civil -  Aula 105 - Encargo Ilícito ou Impossível - Art. 137 do CC','',NULL),(257,'Resumo de Condição; Termo e Encargo - Art. 121 ao 137 do CC','Nessa aula a prof. Séfora Schubert faz um resumo de Condição; Termo e Encargo para os alunos que querem ter uma noção geral sobre esses assuntos.','qLDNN3pIcfM','2016-11-26 21:47:11.025743','2016-08-10 12:29:33.000000','thumbnails/257/4pZSrifKxiJYCzaHdyt3hT','0,21280,718','Direito Civil -  Aula 106 - Resumo de Condição; Termo e Encargo - Art. 121 ao 137 do CC','',NULL),(258,'Defeitos do Negócio Jurídico - Vícios do Consentimento - Vícios Sociais','Nessa aula a prof. Séfora Schubert faz uma introdução aos defeitos do negócio jurídico, e explica que podem ocorrer por vícios do consentimento ou vícios sociais.','qFPa5wEaDnA','2016-11-26 21:47:11.250668','2016-08-12 10:34:50.000000','thumbnails/258/v9mNQkkoNy6wHyioViiVJ3','0,21280,718','Direito Civil -  Aula 107 - Defeitos do Negócio Jurídico - Vícios do Consentimento - Vícios Sociais','',NULL),(259,'Erro - Art. 138 do CC - Vícios do Consentimento Negócios Jurídicos','Nessa aula a prof. Séfora Schubert ensina o Art. 138 do CC que trata do Erro, que é um dos 5 vícios do consentimento previsto no Código Civil.','QsaPHjHTHxM','2016-11-26 21:47:11.586204','2016-08-22 11:54:59.000000','thumbnails/259/fLNfpPeKFispyKWj7T63Af','0,21280,718','Direito Civil -  Aula 108 - Art. 138 do CC - Erro - Vícios do Consentimento Negócios Jurídicos','',NULL),(260,'Erro Substancial Quanto à Natureza do Negócio - Art. 139,I, do CC','Nessa aula a prof. Séfora Schubert explica que o Erro sobre a natureza do negócio jurídico é um erro  substancial que pode acarretar a invalidade do negócio jurídico.','Gz-Dc4NOlEE','2016-11-26 21:47:12.011313','2016-08-26 11:01:07.000000','thumbnails/260/f8nvqP9W2tM3Cr88cgTC2L','0,21280,718','Direito Civil -  Aula 109 - Art. 139,I, do CC - Erro Substancial Quanto à Natureza do Negócio','',NULL),(261,'Erro Substancial Quanto ao Objeto Principal - Art. 139,I, do CC','Nessa aula a prof. Séfora Schubert explica que o negócio jurídico pode ser anulado em caso de erro substancial quanto ao objeto principal do negócio jurídico e quanto à qualidade essencial do objeto.','etOe-BkNEjM','2016-11-26 21:47:12.841143','2016-08-29 11:06:30.000000','thumbnails/261/8DDxJmgMyYzEkDPArfco5F','0,21280,718','Direito Civil -  Aula 110 - Art. 139,I, do CC - Erro Substancial Quanto ao Objeto Principal','',NULL),(262,'Erro Substancial Quanto à Pessoa - Art. 139,II, do CC','Nessa aula a prof. Sefora explica que quando ocorre o Erro quanto à Identidade ou a Qualidade da Pessoa, caracteriza-se o erro substancial, e o negócio jurídico pode ser anulado por Erro.','yGFxkrx5_jY','2016-11-26 21:47:13.767180','2016-09-02 09:16:43.000000','thumbnails/262/WpUxiSxRJy8xWShuuCDX9f','0,21280,718','Direito civil -  Aula 111 - Art. 139,II, do CC - Erro Substancial Quanto à Pessoa','',NULL),(263,'Erro de Direito - Art. 139,III, do CC','Nessa aula, a prof. Séfora explica que o negócio jurídico pode ser anulado no caso de Erro Substancial de Direito.','ShxoWkrrW2o','2016-11-26 21:47:14.483824','2016-09-05 10:51:36.000000','thumbnails/263/KK6q7TDadRNe3mTuzqxo3W','0,21280,718','Direito Civil -  Aula 112 - Art. 139,III, do CC - Erro de Direito','',NULL),(264,'Falso Motivo - Art. 140 do CC - Erro Quanto ao Motivo','Nessa aula a prof. Sefora ensina o Art. 140 do Código Civil que trata do falso motivo. O falso motivo somente vicia a declaração de vontade quando expresso como razão determinante.','IZ3c4AT0RzU','2016-11-26 21:47:15.084205','2016-09-07 13:01:59.000000','thumbnails/264/EWfGUVcBHPc2n3732yjvC4','0,21280,718','Direito Civil -  Aula 113 - Art. 140 do CC - Falso Motivo - Erro Quanto ao Motivo','',NULL),(265,'Transmissão Errônea da Vontade Por Meios Interpostos - Art. 141 do CC','Nessa aula a Prof. Sefora explica que a transmissão errônea da vontade é anulável nos mesmos casos em que é anulável a declaração direta da vontade.','W8x43OW22HM','2016-11-26 21:47:15.262693','2016-09-12 11:01:31.000000','thumbnails/265/y43qzyEuWkKqsZGWkiKz9V','0,21280,718','Direito Civil -  Aula 114 - Art. 141 do CC - Transmissão Errônea da Vontade Por Meios Interpostos','',NULL),(266,'Erro Acidental - Art. 142 e Art. 143 do CC','Nessa aula a prof. Sefora explica o Erro Acidental, previsto no Art. 142 e 143 do Código Civil: Erro sobre a indicação da pessoa; Erro sobre a indicação da coisa e o Erro de cálculo.','cCkVcI7KSBg','2016-11-26 21:47:15.406138','2016-09-14 12:14:03.000000','thumbnails/266/rovVf7CEKuEUNTuWD2gPQQ','0,21280,718','Direito Civil -  Aula 115 - Art. 142 e Art. 143 do CC - Erro Acidental','',NULL),(267,'Princípio da Conservação do Negócio Jurídico - Art. 144 do CC','Nessa aula a prof. Sefora explica o Art. 144 do CC que determina que se uma pessoa quiser anular o negócio jurídico por Erro, mas a outra pessoa se prontificar a executar o contrato na conformidade real do manifestante, o negócio jurídico deve ser mantido.','i8f0M1MjCuM','2016-11-26 21:47:15.572439','2016-09-17 11:28:17.000000','thumbnails/267/7PaSNwZUGcarWrV9tbQGkc','0,21280,718','Direito Civil -  Aula 116 - Art. 144 do CC - Princípio da Conservação do Negócio Jurídico','',NULL),(268,'Dolo Principal e Dolo Acidental - Art. 145 e 146 do CC','Nessa aula a prof. Sefora explica o Art. 145 e Art. 146 do Código Civil, que trata do vício do consentimento Dolo, ensinando o dolo principal e o dolo acidental.','2ep9tUV0aDY','2016-11-26 21:47:15.755469','2016-09-19 11:35:43.000000','thumbnails/268/TJJxGoV4tnd5pNfs4b6boV','0,21280,718','Direito Civil -  Aula 117 - Art. 145 e 146 do CC - Dolo Principal e Dolo Acidental','',NULL),(269,'Dolo Omissivo ou Negativo - Art. 147 do CC','Ness aula a prof. Sefora explica que o dolo omissivo ou negativo ocorre quando uma pessoa e má-fé omite fato ou qualidade que outra pessoa deveria saber, com a intenção de obter vantagem em um negócio jurídico.','8q2bnounamg','2016-11-26 21:47:15.925512','2016-09-21 11:56:24.000000','thumbnails/269/9Fwcp3Snp6TPymMG42Tfz9','0,21280,718','Direito Civil -  Aula 118 - Art. 147 do CC - Dolo Omissivo ou Negativo','',NULL),(270,'Dolo de Terceiro - Art. 148 do CC','Nessa aula a prof. Séfora explica o Art. 148 do CC que trata do dolo de terceiro, que pode ou não anular o negócio jurídico.','fsrIx_sMcC8','2016-11-26 21:47:16.075304','2016-09-24 10:38:59.000000','thumbnails/270/KtXRmmbXbxpwALGTiR9vxL','0,21280,718','Direito Civil -  Aula 119 - Art. 148 do CC - Dolo de Terceiro','',NULL),(271,'Dolo de Representante Legal e  Convencional - Art. 149 do CC','Nessa aula a prof. Sefora Schubert explica que quando o Dolo for cometido pelo Representante Legal, o Representado somente terá responsabilidade até o proveito que obteve, por outro lado se o dolo for cometido pelo Representante Convencional, o Representado terá responsabilidade solidária.','gqs1EFUMjR8','2016-11-26 21:47:16.355040','2016-09-28 11:00:52.000000','thumbnails/271/FDYKVBrov4Xs9TV7SfAoUJ','0,21280,718','Direito Civil -  Aula 120 - Art. 149 do CC - Dolo de Representante Legal e  Convencional','',NULL),(272,'Dolo de Ambas as Partes ou Dolo Bilateral - Art. 150 CC','Nessa aula a prof. Sefora Schubert explica que quando ambas as partes agem com dolo na realização do negócio jurídico, nenhuma delas vai poder alegar o dolo para anular o negócio ou requerer indenização.','BYbfIOIxFm8','2016-11-26 21:47:17.101686','2016-10-05 10:15:40.000000','thumbnails/272/FthnJLQ93PCJM9UC4W9R2Z','0,21280,718','Direito Civil -  Aula 121 - Art. 150 CC - Dolo de Ambas as Partes ou Dolo Bilateral','',NULL),(273,'Coação Absoluta e Coação Relativa','Nessa aula a Prof. Sefora Schubert explica a Coação Absoluta ou Física e a Coação Relativa ou Moral.','K1fEKkwESEw','2016-11-26 21:47:20.880302','2016-10-08 08:33:05.000000','thumbnails/273/uG6fxjBFCet9ZzvRwsk2JE','0,21280,718','Direito Civil -  Aula 122  do CC -  Coação Absoluta e Coação Relativa','',NULL),(274,'Requisitos da Coação - Art. 151 do CC','Nessa aula a prof. Séfora explica os requisitos da coação que estão previstos no Art. 151 do CC.','iFVUZliTSaM','2016-11-26 21:47:21.035284','2016-10-16 00:13:57.000000','thumbnails/274/gDyhGrVyGbKLKjirmxxNQe','0,21280,718','Direito Civil -  Aula 123  -  Art. 151 do CC - Requisitos da Coação','',NULL),(275,'Gravidade da Coação - Art. 152 do CC','Nessa aula a prof. Séfora Schubert explica que vários critérios subjetivos influem na gravidade da coação.','EOXEAjOu3II','2016-11-26 21:47:21.182065','2016-10-19 21:44:56.000000','thumbnails/275/ickmVhB82iDaAUNb2dThaG','0,21280,718','Direito Civil -  Aula 124  -  Art. 152 do CC - Gravidade da Coação','',NULL),(276,'Ameaça do Exercício de Um Direito e Temor Reverencial - Art. 153 do CC','Nessa aula a prof. Séfora Schubert explica que a ameaça de um exercício normal de um direito e o temor reverencial não constituem coação.','6LcKBFF0qzo','2016-11-26 21:47:21.347087','2016-10-22 20:17:00.000000','thumbnails/276/STQN7AnKVwqCUbkdJzEkNW','0,21280,718','Direito Civil -  Aula 125  -  Art. 153 do CC - Ameaça do Exercício de Um Direito e Temor Reverencial','',NULL),(277,'Coação de Terceiro - Art. 154 e 155 do CC','Nessa aula a prof. Séfora Schubert explica que se a parte beneficiada com a coação tivesse conhecimento da coação de terceiro, viciará o negócio jurídico.','O5_4yZaRMmI','2016-11-26 21:47:22.680251','2016-10-26 17:23:02.000000','thumbnails/277/KyW55StiDD2jSbqJqpmmqW','0,21280,718','Direito Civil -  Aula 126  -  Art. 154 e 155 do CC - Coação de Terceiro','',NULL),(278,'Estado de Perigo - Art. 156 do CC','Nessa aula, a Prof. Séfora Schubert explica o vício do consentimento denominado de Estado de Perigo, previsto no Art. 156 do Código Civil.','pPwrzs3yCm0','2016-11-26 21:47:22.867322','2016-11-04 22:56:33.000000','thumbnails/278/8hnx7p7R6dUpTGQUPUb2va','0,21280,718','Direito Civil -  Aula 127  -  Art. 156 do CC - Estado de Perigo','',NULL),(279,'Lesão e seus Elementos Subjetivos - Art. 157 do CC','Nessa aula a prof. Séfora Schubert ensina o vício do consentimento chamado de Lesão e seus elementos subjetivos, que são: premente necessidade e inexperiência.','0unH-6VGeHU','2016-11-26 21:47:23.067594','2016-11-07 15:50:43.000000','thumbnails/279/NEvFYW47cUZ8Jqu6T89gjR','0,21280,718','Direito Civil -  Aula 128 -  Art. 157 do CC - Lesão e seus Elementos Subjetivos','',NULL),(280,'Lesão = Elemento Objetivo - Art. 157, § 1º e 2º do CC','Nessa aula a prof. Séfora Schubert explica o elemento objetivo do vício consentimento denominado Lesão, que é a desproporção entre as prestações.','cFyt1A9OVSQ','2016-11-26 21:47:23.297197','2016-11-09 13:20:25.000000','thumbnails/280/NGAxTPAHomZXyuu2HZt8gC','0,21280,718','Direito Civil - Aula 129 - Art. 157, § 1º e 2º do CC - Lesão = Elemento Objetivo','',NULL),(281,'Descomplicando Fraude Contra Credores','Nessa aula a prof. Séfora Schubert explica de forma simples e objetiva o Defeito do Negócio Jurídico denominado de Fraude Contra Credores, que está disciplinada do Art. 158 a 165 do Código Civil. Nas próximas aulas estudaremos Fraude Contra Credores artigo por artigo.','0MKfxDhnHho','2016-11-26 21:47:23.490190','2016-11-13 14:05:02.000000','thumbnails/281/RHU6ieVEvuCGDptaDvypYM','0,21280,718','Direito Civil -  Aula 130 -  Descomplican